    public static class CheckObjectType
    {
        public static void Check()
        {
            // 将 JSON 转换为对象
            var content = JsonConvert.DeserializeObject<Dictionary<string, object>>(jsonString);

            var data = new Dictionary<string, object>();
            foreach (var contentItem in content)
            {
                if (contentItem.Value is JObject jObject)
                {
                    // 使用 JToken.ToObject 方法进行更具体的类型转换
                    ValueDto newObj = jObject.ToObject<ValueDto>();
                    Console.WriteLine($"{newObj.ManualValue}-{newObj.AutoFillValue}");
                    if (newObj.ManualValue != null)
                    {
                        data.Add(contentItem.Key, newObj.ManualValue);
                        continue;
                    }
                    data.Add(contentItem.Key, newObj.AutoFillValue);
                }
                else
                {
                    // JToken 对象无法转换为目标类型
                    Console.WriteLine(contentItem.ToString());
                    data.Add(contentItem.Key, contentItem.Value);
                }
            }
            Console.WriteLine($"转换后结果：{JsonConvert.SerializeObject(data)}");
        }

